  IDAVIES, Wendy Elizabeth and PALMER, Robert William
  01> DAVIES, Wendy Elizabeth m on 28.03.1970 to PALMER, Robert William
  b 16.10.1947
  b 06.02.1946 d 23.06.1981
  Wendy b. at Lautoka, Fiji and m. at St Martin's Anglican Church, Christchurch.
  Separated. Wendy uses her maiden name. Robert b. at Auckland and d. in Hawaii.
  Commemoration service at King's College, Auckland. Address: 11 Rautangi Road, Mount
  Eden, Auckland.
  Wendy attended Canterbury University (1966-68) then graduated in 1975 from Auckland
  University with a BA in Sociology. She worked in the travel industry until 1982
  then returned to Christchurch University for two years post-graduate study in Landscape
  Architecture. She won the Student Merit Award of the NZ Institute of Landscape Architects. She
  worked for two years with the Ministry of Works and Development in Auckland then became landscape
  architect with a large engineering consultancy for four years. She is now in private practice and
  currently involved in visual impact studies and giving evidence in support of restrained coastline
  settlement in scenic areas, including the Auckland Harbour edge.
  Wendy is a trustee of the New Zealand Native Forests Restoration Trust and a member of the Auckland
  Civic Trust. She is keen to foster the principles of social justice espoused by her missionary
  forebears. Her other interests include history, literature, art, photography, gardens, skiing and
  sailing.
  02> DAVIES, Kathleen Rosemary m on 29.01.1972 to (1)McCORMACK, David Ian
  b 17.03.1949
  b 24.04.1944
  Kathleen b. at Ba, Fiji and m. at St Mary's Anglican Church, Christchurch. Divorced. David, s/o
  James and Gladys McCormack, b, at Warkworth.
  01> McCORMACK, Reuben David
  b 14.11.1974
  Address: 7 Johnathon Place, Sunnynook, Auckland.
  Reuben was a boarder at St Andrew's College, Christchurch. He has attended school in the USA
  and completed a Himalayan Mountaineering course in Darjeeling, where he won best all-round
  student. He plays the clarinet and attends Air Training.
  02> McCORMACK, Sada Elizabeth
  b 22.01.1978
  Sada attends North Shore Grammar School and plays the violin in the North Shore Junior
  orchestra.
  02> DAVIES, Kathleen Rosemary m on 05.03.1988 to (2)MCLENNAN, Murray
  Matthew
  b 17.03.1949
  b 12.06.1950
  Kathleen m. at Takapuna, Auckland. Murray, slo Kenneth McLennan and Catherine
  Summers, b. at Carterton. Address: 27 Westwell Road, Takapuna, Auckland.
  Kathleen was educated at Hillmorton High School, Christchurch, and trained as a
  kindergarten teacher in Christchurch. She taught at Waimate and Waiuku, then at
  Northbridge, Auckland. In 1980-81 she trained as an interior designer and since then
  has worked as an interior design consultant in Remuera, Auckland. Her other
  interests include gardening, cross-stitch, tennis and skiing.
  Murray was brought up in Carterton and completed a carpentry and joinery apprenticeship in 1968. He
  worked at Franz Josef Glacier before joining Air New Zealand as a flight attendant in 1974. He has
  a commercial pilot's licence and has built his own aeroplane. He also enjoys skiing.
  Kathleen trained as a kindergarten teacher and now works as a design decorator. Murray is an
  airline officer and a builder.
